import React from 'react';
import {Route, Routes} from "react-router-dom";
import Top from "./Top";
import Form from "./Form";


const Main = () => {
    return (
        <div>
            <Routes>
                <Route path="/" element={<Top/>}/>
                <Route path="/Form" element={<Form/>}/>
            </Routes>
        </div>
    );
};

export default Main;
